77  [DEBUG][2025-05-07 22:51:03] .../vim/lsp/rpc.lua:330 "rpc.receive" { id = 3, jsonrpc = "2.0" }


I see the response sends `{ id = 3, jsonrpc = "2.0" }` which does not include the body.

To give more context the vscode extension has to use a hack to access `tsserver` to execute command: https://github.com/vuejs/language-tools/blob/5d2731321a8efca4e82677f37f6e10139d7e0043/extensions/vscode/src/nodeClientMain.ts#L160-L164, and this is the PR that implemented it in vue lsp: https://github.com/vuejs/language-tools/pull/5252.

Is this the similar thing that it is a known limitation caused by typescript `tsserver`?

Any insight would be helpful, thanks in advance.
